Оренда офісу (4 поверх) - кабінетна система - 3500 м.кв., у БЦ на Сурикова.

Бізнес-центр розташований у Солом'янському районі Києва за адресою вул. Сурикова, 3а (поряд із супермаркетом Ультрамаркет). 
5 хвилин пішки до Солом'янської площі, 15-18 хвилин до метро Вокзальна.

Комерційні умови оренди

Ціна оренди - 100 грн/кв.метр + ПДВ
Експлуатаційні витрати (орех) - 50 грн/кв.метр + ПДВ.
та комунальні окремо.

