- каналізація централізована;
- вода з артезіанських скважин;
- 10 кВт на будинок;
- висота стелі – 3,5 м для кожного рівня;
- стіни з газоблоку, утепелені мінеральною ватою;
- дах – металочерепиця;
- металопластикові 2-камерні склопакети.

